import React, { Component, useState } from "react";
import { NavLink } from "react-router-dom";
import style from "./Nav.module.css";

export default function Nav() {
  return (
    <nav className={style.sideNav}>
      <ul>
        <li>Home</li>

        <NavLink to="/projects">
          <li>Projects</li>
        </NavLink>
        <NavLink to="/digitalMedia">
          <li>Digital Media</li>
        </NavLink>
        <NavLink to="/about">
          <li>About</li>
        </NavLink>
      </ul>
    </nav>
  );
}
